Das größte Gebäude auf dem Server? Das haben wir leider noch nicht, doch die Betonung liegt ganz stark auf NOCH, denn genau das wird sich heute ändern! Da unser Clan, die schwarze Spriale, leider noch keine ordentliche Basis hat, habe ich mich dazu entschieden innerhalb eines Tages die höchste Base auf dem Server zu bauen. Wie sie am Ende aussieht und was die Reaktionen der Member aus meinem Clan sind, das seht ihr in diesem Video! :D

Das Ganze ist auf dem MysticSMP, nicht auf Craft Attack 12, der YouTuber Insel, dem DreamSMP oder Minecraft Helden. Die Reihe inspiriert sich von Parrot, aka. ParrotX2 und der Serie vom Lifesteal SMP und dem Unstable Universe. 

